import React from "react";

function FilterPanel({ consultationType, onConsultationTypeChange }) {
  return (
    <div>
      <h5>Consultation Type</h5>
      <div>
        <label>
          <input
            type="radio"
            name="consultation"
            value="Video Consult"
            checked={consultationType === "Video Consult"}
            onChange={onConsultationTypeChange}
            data-testid="filter-video-consult"
          />
          Video Consult
        </label>
        <label>
          <input
            type="radio"
            name="consultation"
            value="In Clinic"
            checked={consultationType === "In Clinic"}
            onChange={onConsultationTypeChange}
            data-testid="filter-in-clinic"
          />
          In Clinic
        </label>
      </div>
    </div>
  );
}

export default FilterPanel;
